В связи с улучшающейся ситуацией с COVID-19 в Москве смягчат действующие в городе меры:
 отменяется требование об обязательном переводе на удаленку 30 процентов сотрудников;
 горожане снова смогут посещать крытые помещения на территории зоопарков.

 На оперативном штабе #Волжскийрайон по #COVID19 принято решение, что на неделе с 08.11. по 13.11.21 г.:

 1-4 классы - очно;
 5-8 и 10 классы - дистант; 
 9, 11 классы - очно;
 СПО - дистант;
 допобразование - дистант;
 д/сады - в штатном режиме.

