Пандемия.
Это уже не катаклизма, а долгий процесс. В данный момент важно:
- многопрофильность оказание медуслуг;
- вторичная профилактика;
- многопрофильная реабилитация остаточных явлений Covid19;
- подготовка специалистов в широком смысле слова, соответс. мировым стандартам

